import React from 'react'
import { Link } from 'react-router-dom';
import { Datum, RootObject } from '../model';
import s from './PagesStyles/MainPage.module.scss';

const jsonData: RootObject = require('./../data.json')

const MainPage = () => {

   return (
      <div>
         {jsonData.data.map((review: Datum) => (
            <div key={review.id} className={s.wrapper}>
               <h2 style={{'margin': ''}}>{review.attributes.name}</h2>
               <div style={{}}>{review.attributes.rating}</div>
               <small>console list</small>
               <p>{review.attributes.description.substring(0, 200)}...</p>
               <Link to={`/${review.id}`}>Читать полностью</Link>
            </div>
         ))}
      </div>
   )
}

export default MainPage;
